function matMul(a,b)
    n = size(a,1)
    m = size(a,2)
    p = size(b,2)
    
    ab = zeros(eltype(a), (n,p))
    for i in 1:n
        for j in 1:p
            for k in 1:m
                ab[i,j] += a[i,k]b[k,j]
            end
        end    
    end
    
    return ab
end


